                subdomains: "1234",
                tileSize: 256,
                minZoom: 0,
                maxZoom: 18
            };
            map.addLayer(new L.TileLayer(tileOptions.tileUrl, tileOptions));
            mapLarge.addLayer(new L.TileLayer(tileOptions.tileUrl, tileOptions));
            var pinIcon = L.Icon.extend({
                iconSize: new L.Point(20, 23),
